import React from 'react';
import  './card.css'
import Card from 'react-bootstrap/Card'
import Button from 'react-bootstrap/Button'
import Details from '../cards/details'
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

export default function Carts({data}) {

  let fullName = data["full-name"];
  let birthPlace=data["place-of-birth"]

  return (

<Router>
<Route exact path='/' component={<Card style={{ width: '18rem',margin:"10px",display:"inline-block"}}>
        {data.url ?<Card.Img variant="top" component={Link} to="/details" src={data.url} />:<Card.Img variant="top" component={Link} to="/details" src="https://www.superherodb.com/pictures2/portraits/10/100/1508.jpg" />}
        <Card.Body>
          <Card.Title>{data.name}</Card.Title>
          <Card.Text>
            {fullName}
          <br></br>
            {birthPlace}
            <br></br>
           {data.publisher}

        </Card.Text>
          <Button variant="primary" component={Link} to="/details">More Details</Button>
        </Card.Body>
      </Card>}/> {/* app = home */}
  <Route  path='/deatils' component={<Details/>}/>

    </Router>

    )






}
